import React from "react";
import "../css_styles/cards.css";
import { Link } from "react-router-dom";
import { Grid, ImageList, ImageListItem } from "@mui/material";

const Cards = ({ tech }) => {
  return (
    <div className="card">
      <Grid>
        <Grid item lg={3} md={3} sm={6} xs={6} className="card-ads"></Grid>
        <Link to="/news-detail">
          <Grid item lg={6} md={6} sm={6} xs={6}  className="card-content">
          <ImageList sx={{ width: 500, height: 450 }} cols={3} rowHeight={164}>
              <ImageListItem >
                <img
                  src={tech.urlToImage}

                  loading="lazy"
                />
              </ImageListItem>
            ))}
          </ImageList>
            <h2 className="cards__title">{tech.title}</h2>
          </Grid>
        </Link>
        <Grid item lg={3} md={3} sm={6} xs={6}  className="card-ads"></Grid>
      </Grid>
    </div>
  );
};

export default Cards;
